import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';

function App() {
  const [loading, setLoading] = useState(true);
  useEffect(() => {
    fetch('https://yts.mx/api/v2/list_movies.json?minimum_rating=8.5&sort_by=year').then((response) => response.json()).then((json) => console.log(json));
    setLoading(false);
  }, []);
  return (
    <div className="App">
      {loading ? <h1>loading</h1> : null}
    </div>
  );
}

export default App;
